import React from 'react';

const VideoPlayer= props =>{

  console.log(props);
  const {videoId} = props;
  if(!videoId)return null;
  const url=`https://youtube.com/embed${videoId}`
  return (

      <iframe src={url} title={videoId} />

  )


}
export default VideoPlayer;
